import Header from './layouts/Header';
import "./App.css"
import Home from './pages/Home';

const customTheme = {
  button: {
    color: {
      black: '#0d1728',
      blackGray: '#11242e',
      blue: '#00B7FF',
      white: '#FFF',
    },
  },
};

const App = () => {
  return (
    <>
      <Header />
      <Home />
    </>
  );
}

export default App;
